import {React, setState} from "react";
import Logo from './logo.svg';

import './style.css';

export default function Header() {

    const [link, setLink] = setState();

    return (
        <>
            <ul>
                <li className="d-flex logo">
                    <img src={Logo} style={{
                        marginRight: "10px",
                    }} />
                    <h2>Gyber.org</h2>
                </li>
                <li>
                    <ul className="d-flex space-between list">
                        <li>Home</li>
                        <li>Philosophy</li>
                        <li>Lite Paper</li>
                    </ul>
                </li>
                <li>
                    <a className="rgbBtn">Private sale</a>
                </li>
            </ul>
        </>
    );
}
